const SOCIAL_PROFILES = [
  {
    id: 1,
    link: 'mailto:romanqramirez@gmail.com',
    image: emailIcon,
  },
  {
    id: 2,
    link: 'https://github.com/romanramirez',
    image: githubIcon,
  },
  {
    id: 3,
    link: 'https://www.linkedin.com/in/robertsterlingramirez/',
    image: linkedinIcon,
  },
  // {
